import React, { useEffect, useState } from 'react';

const TableData = () => {


    const sa = (e)=>{
        e.ta
    }
    
    const [show, setShow] = useState(false);
    const [users, setUser] = useState([{}]);
    useEffect(() => {

        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')
                setUser(data);
                setShow(true);
            })
    }, []);

    return (

        <>
           
                <center>
            <h1>
                {show && 
                <h1>
                    <>

                    {
                        Object.keys(users).map((key, i) => (
                            
                            <select onChange={sa} style={{"margin":"15px"}}>
                                {
                                    Object.keys(key).map((keys,i)=>(
                                       
                                        <option  className='btn btn-primary'>
                                            
                                            <button>

                                            {users[key][i]}
                                            </button>
                                            </option>
                                        ))           
                                    }
                                </select>
                        ))
                        
                        
                    
                            
                    }
                        
                    <div className='container'>


                    <form action="/sign" method ="post">
        <div class="mb-3 mt-3">
          <label for="subject" class="form-label">Subject:</label>
          <input type="text" style={{"text-align": "center"}} class="form-control" id="email" value="abcd" placeholder="Enter Subject" name="subject"/>
        </div>
        <div class="mb-3">
          <label for="text" class="form-label">Text:</label>
          <input type="text" style={{"text-align": "center"}} class="form-control" id="pwd" value="abcd" placeholder="Enter text" name="text"/>
        </div>
        <div class="mb-3">
          <label for="html" class="form-label">Html:</label>
          <input type="text" style={{"text-align": "center"}} class="form-control" id="pwd" value="abcd"  placeholder="Enter html" name="html"/>
        </div>
        <button type="submit" class="btn btn-primary">Submit</button>
      </form>
    

                    </div>

                    </>
                </h1>
                }

            </h1>
                </center>
        </>
    );
};

export default TableData;
